import React, {Component} from 'react';
import {BrowserRouter as Router, Route,Link, Redirect } from 'react-router-dom'
import Createpro from './create-product';
import Viewpro from './view-product';
import Ready from './rtodis-product';
import Dispatched from './dis-product';


export default class vendor extends Component {
	render(){
		console.log(this.props.match.params.id);
		return (
			<Router>
			<div>
				<nav style={{ lineWidth:"1500px"}}>
				<div style={{ display: "flex",flexDirection: "row",justifyContent: "space-between", alignItems: "center",flexWrap: "Wrap" }}>
					<div className="nav-wrapper white" style={{ width: "25%"}}>
						<Link
							to={"/vendor/"+this.props.match.params.id+"/create"}
							style={{fontFamily: "monospace",fontSize:"20px"}}
							className="col s5 brand-logo center black-text"
						>
							Create
						</Link>
					</div>
					<div className="nav-wrapper white" style={{ width: "25%"}}>
						<Link
							to={"/vendor/"+this.props.match.params.id+"/view"}
							style={{fontFamily: "monospace",fontSize:"20px"}}
							className="col s5 brand-logo center black-text"
						>
							View
						</Link>
					</div>
					<div className="nav-wrapper white" style={{ width: "25%"}}>
						<Link
							to={"/vendor/"+this.props.match.params.id+"/ready"}
							style={{fontFamily: "monospace",fontSize:"20px"}}
							className="col s5 brand-logo center black-text"
						>
							Ready
						</Link>
					</div>
					<div className="nav-wrapper white" style={{ width: "25%"}}>
						<Link
							to={"/vendor/"+this.props.match.params.id+"/dispatched"}
							style={{fontFamily: "monospace",fontSize:"20px"}}
							className="col s5 brand-logo center black-text"
						>
							Dispatched
						</Link>
					</div>
				</div>
			</nav>

			<Route path={"/vendor/:id/create"} component={Createpro}/>
			<Route path={"/vendor/:id/view"} component={Viewpro}/>
			<Route path={"/vendor/:id/ready"} component={Ready}/>
			<Route path={"/vendor/:id/dispatched"} component={Dispatched}/>

			</div>
			</Router>
		);
	}
}
